import React, { useState } from 'react';

const OCTClassifier = () => {
  const [selectedImage, setSelectedImage] = useState(null);
  const [preview, setPreview] = useState(null);
  const [selectedModel, setSelectedModel] = useState("mobilenet_v3");
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const models = [
    { value: "mobilenet_v3", label: "MobileNet V3" },
    { value: "efficientnet_b0", label: "EfficientNet B0" },
    { value: "squeezenet1_1", label: "SqueezeNet" },
    { value: "resnet50", label: "ResNet50" },
    { value: "resnet18", label: "ResNet18" },
    { value: "mobilevit_s", label: "MobileViT" }
  ];

  const handleImageChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      setSelectedImage(file);
      setPreview(URL.createObjectURL(file));
      setPrediction(null);
      setError("");
    }
  };

  const handleModelChange = (event) => {
    setSelectedModel(event.target.value);
    setPrediction(null);
  };

  const classifyImage = async () => {
    if (!selectedImage) {
      setError("Please upload an image first.");
      return;
    }

    setLoading(true);
    setError("");

    const formData = new FormData();
    formData.append("file", selectedImage);
    formData.append("model", selectedModel);

    try {
      const response = await fetch("http://127.0.0.1:5000/api/classify", {
        method: "POST",
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      setPrediction(data);
    } catch (error) {
      setError("Error processing image. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="p-8 bg-gray-50 min-h-screen">
      <div className="max-w-4xl mx-auto">
        <h2 className="text-3xl font-bold mb-8 text-center text-gray-800">
          OCT Image Classification
        </h2>

        <div className="bg-white rounded-lg shadow-md p-6 mb-8">
          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Upload Image
            </label>
            <input
              type="file"
              accept="image/*"
              onChange={handleImageChange}
              className="w-full text-sm text-gray-500 file:mr-4 file:py-2 file:px-4 file:rounded-full file:border-0 file:text-sm file:font-semibold file:bg-blue-50 file:text-blue-700 hover:file:bg-blue-100"
            />
          </div>

          <div className="mb-6">
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Select Model
            </label>
            <select
              value={selectedModel}
              onChange={handleModelChange}
              className="w-full p-2 border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
            >
              {models.map((model) => (
                <option key={model.value} value={model.value}>
                  {model.label}
                </option>
              ))}
            </select>
          </div>

          <button
            onClick={classifyImage}
            disabled={loading || !selectedImage}
            className={`w-full py-2 px-4 rounded-md text-white font-medium ${
              loading || !selectedImage
                ? "bg-gray-400 cursor-not-allowed"
                : "bg-blue-600 hover:bg-blue-700"
            }`}
          >
            {loading ? "Processing..." : "Classify Image"}
          </button>
        </div>

        {error && (
          <div className="bg-red-50 border-l-4 border-red-400 p-4 mb-8">
            <p className="text-red-700">{error}</p>
          </div>
        )}

        {preview && (
          <div className="bg-white rounded-lg shadow-md p-6 mb-8">
            <h3 className="text-lg font-medium text-gray-900 mb-4">
              Original Image
            </h3>
            <img
              src={preview}
              alt="Preview"
              className="w-full max-h-96 object-contain rounded-lg"
            />
          </div>
        )}

        {prediction && (
          <div className="bg-white rounded-lg shadow-md p-6 mb-8">
            <h3 className="text-lg font-medium text-gray-900 mb-4">
              Classification Results
            </h3>
            <div className="space-y-2">
              <p className="text-gray-700">
                <span className="font-medium">Condition:</span> {prediction.class}
              </p>
              <p className="text-gray-700">
                <span className="font-medium">Confidence:</span> {prediction.confidence}%
              </p>
            </div>
          </div>
        )}

        {prediction && prediction.gradcam && (
          <div className="bg-white rounded-lg shadow-md p-6">
            <h3 className="text-lg font-medium text-gray-900 mb-4">
              Grad-CAM Visualization
            </h3>
            <img
              src={`data:image/png;base64,${prediction.gradcam}`}
              alt="Grad-CAM visualization"
              className="w-full max-h-96 object-contain rounded-lg"
            />
          </div>
        )}
      </div>
    </div>
  );
};

export default OCTClassifier;
